import React, { Component } from 'react';
import { Layer, Card, CardBody, CardFooter, CardHeader, Button, Form, FormField, TextInput, Box } from 'grommet';

const OPTIONS = ['First', 'Second', 'Third'];

 class CustomEntryCard extends Component {
    state = { 
        value: [], 
        options: OPTIONS,
    }

    setValue = (value) => {

    }

    render() {
    const { options, value } = this.state;
    return (
        <Card  height="medium"  width="large" background="light-1">
            <CardHeader align="center" pad="medium">Custom Entry</CardHeader>
            <CardBody pad="medium">
                <Form
                    value={value}
                    onChange={nextValue => this.setValue(nextValue)}
                    onReset={() => this.setValue({})}
                    onSubmit={({ value }) => {}}
                >
                    <Box direction="row" gap="medium">
                    <FormField name="name" htmlFor="name-input" label="Name">
                        <TextInput id="name-input-id" name="name" />
                    </FormField> 
                    <FormField name="area" htmlFor="area-input" label="Area">
                        <TextInput id="area-input-id" name="area" />
                    </FormField>
                    </Box>

                    <Box direction="row" gap="medium">
                    <FormField name="type" htmlFor="type-input" label="Type">
                        <TextInput id="type-input-id" name="type" />
                    </FormField>
                    <FormField name="area" htmlFor="area-input" label="Area">
                        <TextInput id="area-input-id" name="area" />
                    </FormField>
                    </Box>

                    <Box direction="row" gap="medium">
                        <Button type="submit" primary label="Submit" />
                        <Button type="reset" label="Reset" />
                    </Box>
                </Form>
            </CardBody>
            <CardFooter pad={{horizontal: "small"}} background="light-2">   
            </CardFooter>
        </Card>
    );
    }
}

export default CustomEntryCard;
